import styled, {keyframes} from "styled-components";


//Theme
const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  width: 100vw;
`;

const Title = styled.h1`
  color: ${(props) => props.theme.textColor}
`;

function App(){
  return <Wrapper>
    <Title>Hello</Title>
  </Wrapper>;

}


export default App;
